gras: {}
grapi:
  beimagetag: "v0.112"
  discoveredrepos: true
  ingress: true
  datasources:
  - name: "db"
    spec:
      memory:
        connector: "memory"
        name: "db"
        file: "./db.json"
        localStorage: "db"
  prediscoverypatches:
  - name: patchDbFile
    content: 
  models:
  - name: "customers"
    content: 
  - name: "employees"
    content: 
  relations:
  - name: "employees"
    spec:
      relationName: "employees"
      sourceModel: "Customers"
      destinationModel: "Employees"
      foreignKeyName: "employeesId"
      relationType: "belongsTo"
      registerInclusionResolver: true
  restcruds:
  - name: "restcrud"
    spec:
      datasource: "db"

gruim:
  uiimagetag: "0.1.34"
  style: '{"colors":{"primary":{"DEFAULT":"#34344A","fg":"#fff"},"accent":{"DEFAULT":"#CC5A71","fg":"#fff"}}}'
  config: ""
  additionalpackages: ""
